(11, '他の部屋の家具も高級品です', '他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です他の部屋の家具も高級品です', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/dace031399eac36d512f56515a58d561_1729579097.jpg', NULL, 0, 14, '2024-08-27 06:31:27', '2024-10-22 06:38:17', NULL),
(13, '上品な佇まいのラグジュアリーソファ', '重厚感がありながらも、軽やかな存在感を放つスペリオルソファ。テーパード加工された木製フレームを金属の脚が支えており、足元の浮遊感が印象的なデザインです。サイズバリエーションも豊富でL字型や、ソファ＋オットマン、デイベッドとの組み合わせなどリビングでの過ごし方に応じてのレイアウトが可能です。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image01_superior_1724915547.jpg', NULL, 0, 3, '2024-08-29 07:12:27', '2024-09-10 06:54:37', NULL),
(14, '身体を包み込む最高の寛ぎソファ', '最高級の綿布団の心地よさを生かしたシアトルソファ。ベース部分には耐久性と弾力に優れたコイルスプリングを採用し、このコイルスプリングと綿布団の絶妙な組み合わせで他にないリラックスとした座り心地を再現しています。また、背クッションには枕の3倍の羽毛と綿を詰めてボリューム感があり、身体をしっとりと包み込んでくれる心地よさがあります。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image02_seattle_1724915596.jpg', NULL, 1, 8, '2024-08-29 07:13:16', '2024-09-11 03:03:26', NULL),
(15, 'ふわっと包み込む座り心地のソファ', 'リラックスした体勢そのままを受け入れてくれるアルニカソファ。身体を包み込む柔らかさは、ほっとできる癒しのラグジュアリー空間となります。使用する事でクッションが馴染み、風合いが出てきたエイジングによりこのソファは完成形になっていきます。経年変化も楽しんでいただける肩の力が抜けた究極のやすらぎソファです。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image03_arnica_1_1724915649.jpg', NULL, 0, 1, '2024-08-29 07:14:09', '2024-09-10 06:54:37', NULL),
(16, '大人のくつろぎ空間①', 'ダークカラーを基調に石目や木目のマテリアルをアクセントに取り入れてコーディネートしています。ダイニングテーブルは大理石天板とアイアン脚の異素材の組み合わせで、素材感のあるアイテムが空間にアクセントを付けています。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image04_1_1724915702.jpg', NULL, 1, 6, '2024-08-29 07:15:02', '2024-09-11 03:03:38', NULL),
(17, '大人のくつろぎ空間②', 'ダークカラーを基調に石目や木目のマテリアルをアクセントに取り入れてコーディネートしました。ソファはL字のラウンドタイプを採用し、イタリアンモダンなテイストも取り入れています。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image05_1_1724915760.jpg', NULL, 0, 4, '2024-08-29 07:16:00', '2024-09-09 06:28:23', NULL),
(18, '黒を基調としたシックなインテリア空間', '黒を基調としたキッチン合わせて家具は黒やグレーをメインにコーディネートし、照明や小物などでゴールドを採用しアクセントとしました。木、セラミック、スチールといった素材の豊かな質感と色合いの組み合わせで心地よい空間を演出します。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image06_1_1724915803.jpg', NULL, 1, 5, '2024-08-29 07:16:43', '2024-09-11 03:03:38', NULL),
(19, '包み込まれるようなラウンジチェア', 'しっかりとした木製のフレームに、浮かぶようにクッションを設置したヴィスキオラウンジチェア。特徴的な大きめのアームレストは、サイドテープルとしても使えるくらいのサイズがあり、読みかけの本や好きな飲みものを置くことができます。身体を預けてしまう、包み込まれるようなチェアです。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image07_1_1724915874.jpg', NULL, 0, 9, '2024-08-29 07:17:54', '2024-09-11 03:03:14', NULL),
(20, 'モダンながらも柔らかな空間', 'ウォールナット×ホワイト・ライトグレーをベースに、モダンながらも柔らかい空間を演出しています。ナチュラルになり過ぎずないよう素材は大理石やセラミックなどを活用し、シンプルでデザイン性のあるアイテムでコーディネートしています。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image08_1_1724915915.jpg', NULL, 0, 10, '2024-08-29 07:18:35', '2024-09-11 03:03:12', NULL),
(21, '素材感際立つインテリア', '重厚感のあるどっしりとしたソファと、軽快なテイストのダイニングテーブル・チェアを組み合わせることで空間にメリハリを付け、無垢材のテーブルや本革のソファなど素材感のあるアイテムでコーディネートにしています。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image09_1724915973.jpg', NULL, 1, 7, '2024-08-29 07:19:33', '2024-09-11 03:03:26', NULL),
(22, 'ウォールナット×アイアン', '床材のウォールナットやアイアンの建具などに合わせ、家具もウォールナットをベースに、アイアンやスチールなどの素材を取り入れ、異素材の組み合わせでコーディネートしていました。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image10_1_1724916015.jpg', NULL, 0, 11, '2024-08-29 07:20:15', '2024-09-09 06:26:39', NULL),
(23, '自由な組み合わせを楽しむソファ', '直線的でシンプルなフォルムに、金属の華奢な脚が特徴のキングストンソファ。ゆったりとした座面は、足を上げても十分に寛げる広さを確保し、床座で寛ぐことに慣れている日本の生活様式を、ソファの上で贅沢に実現しました。サイズバリエーションが豊富で、空間に合わせて自由自在にレイアウトを組めるフレキシブルなソファです。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image11_1_1724916058.jpg', NULL, 0, 12, '2024-08-29 07:20:58', '2024-09-09 06:26:32', NULL),
(24, 'ハンモックチェアで遊び心のある空間を演出', '全体的にウォールナットをメインとしたブラウンとブラックでコーディネートし、モダンな空間を演出しています。その中でハンモックチェアをアクセントに取り入れ、遊び心のある空間にしています。', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/image12_1_1724916155.jpg', NULL, 0, 13, '2024-08-29 07:22:35', '2024-09-09 06:26:23', NULL),
(27, 'Test', 'Test', 'https://logmansion-app.s3.ap-northeast-1.amazonaws.com/staging/catalogue/1_1729579086.jpg', NULL, 1, 15, '2024-10-22 06:36:41', '2024-10-22 06:38:06', NULL);
