(53, 0, 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？', 'アフタサービス期間が切れてしまった場合でも、有償にて対応は可能です。内容をお知らせいただければお見積もりさせていただきます。お問い合わせにご相談内容をお寄せください。', 1, 53, '2024-08-30 00:45:58', '2024-09-11 06:20:31', '2024-09-11 06:20:31'),
(54, 0, '鍵をなくしてしまいました。', '鍵を紛失してしまった場合、開錠業者に対応を依頼してください。\r\nお客さまの安全とプライバシー保護の観点に基づき、弊社では鍵の保管はしておりません。\r\n合鍵等を紛失してしまった場合は、念の為、鍵の付替をお勧めします。', 1, 55, '2024-08-30 00:46:54', '2024-09-13 08:16:07', NULL),
(55, 1, '機種変更するのですが、今まで通り使えますか？', 'アプリを再度ダウンロードしてください。契約番号とパスワードを入力すれば、今まで通りお使いいただけます。', 0, 54, '2024-08-30 00:52:08', '2024-09-26 05:24:14', NULL),
(56, 1, 'このアプリを家族で共有したいのですが。', '申し訳ありません。一契約についてお一人様のみのご利用となっておりますので、複数の方がご利用になることはできません。', 1, 56, '2024-08-30 08:16:59', '2024-09-26 05:00:42', NULL),
(57, 0, 'test', 'tesst', 0, 57, '2024-09-10 07:16:34', '2024-09-11 06:20:34', '2024-09-11 06:20:34'),
(58, 0, 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？', 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？', 1, 58, '2024-09-10 08:26:21', '2024-09-11 06:20:23', '2024-09-11 06:20:23'),
(59, 1, '機種変更するのですが、今まで通り使えますか？4', 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？1', 0, 60, '2024-09-10 08:26:51', '2024-10-10 05:15:53', '2024-10-10 05:15:53'),
(60, 0, '機種変更するのですが、今まで通り使えますか？3', 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？2', 0, 62, '2024-09-10 08:27:03', '2024-09-26 05:21:14', NULL),
(61, 0, '機種変更するのですが、今まで通り使えますか？2', 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？3', 0, 61, '2024-09-10 08:27:16', '2024-10-10 05:13:43', '2024-10-10 05:13:43'),
(62, 0, '機種変更するのですが、今まで通り使えますか？6', 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？4', 0, 64, '2024-09-10 08:27:24', '2024-09-26 05:22:34', NULL),
(63, 0, '機種変更するのですが、今まで通り使えますか？5', 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？5', 0, 66, '2024-09-10 08:27:40', '2024-10-10 05:16:17', '2024-10-10 05:16:17'),
(64, 1, '契約番号とはなんですか？', '契約番号は当アプリを利用する上で必要なIDです。管理上変更することができませんので、大切に保管してください。', 1, 59, '2024-09-10 08:28:21', '2024-09-26 05:02:39', NULL),
(65, 0, 'アフターサービスの保証期間が切れてしまいましたが、ご対応いただけますか？', 'アフタサービス期間が切れてしまった場合でも、有償にて対応は可能です。内容をお知らせいただければお見積もりさせていただきます。「お問い合わせ」にご相談内容をお寄せください。', 1, 63, '2024-09-19 07:09:55', '2024-09-19 07:12:27', NULL),
(66, 1, '機種変更するのですが、今まで通り使えますか？', 'アプリを再度ダウンロードしてください。契約番号とパスワードを入力すれば、今まで通りお使いいただけます。', 1, 67, '2024-09-26 04:58:19', '2024-09-26 05:05:10', NULL),
(67, 1, '登録したメールアドレスを変更したいです。', 'マイページから変更することができます。\r\nメールアドレス変更', 1, 65, '2024-09-26 05:04:57', '2024-09-26 05:22:19', NULL),
(68, 0, '車を購入するので、車庫証明がほしいです。', '賃貸の敷地内駐車場の場合は、管理組合にて発行する場合がほとんどです。管理組合もしくは管理員にご確認ください。', 1, 68, '2024-09-26 05:20:36', '2024-09-26 05:20:36', NULL);
